import React, {useState} from 'react';


//Create an array of data
const employees = [
  {name: "Magnus", id: 1},
  {name: "Oda", id: 2},
  {name: "Jørgen", id: 3}
];

export default function App() {
  return (
    <div className="App">
      {employees.map((employee) => (
        <h1>{employee}</h1>
      ))}
    </div>
  );
}
